import styled from 'styled-components/native';
import Colors from '../../constants/colors';

const Container = styled.View`
  flex: 1;
  align-items: center;
  padding: 42px;
  justify-content: center;
`;

const WebConf = styled.Image`
  width: 200px;
  height: 200px;
`;

const Cafe = styled.Image`
  width: 280px;
  height: 160px;
`;

const CafeImgView = styled.View`
  align-self: center;

`;

const AlternateLogin = styled.View`
  padding-top: 16px;
  flex-direction: row;
  align-items: center;
`;

const AlternateLoginText = styled.Text`
  font-size: 20px;
  padding: 10px;
  font-weight: 600;
  color: ${Colors.blue};
`;

const LoadingText = styled.Text`
  font-size: 20px;
  text-align: center;
  padding: 10px;
  font-weight: 400;
  color: ${Colors.blue};
`;

const LoadingContainer = styled.View`
  justify-content: center;
  align-items: center;
  background-color: ${Colors.lightGray100};
  border-radius: 20px;
  padding: 25% 0;
  width: 100%
`;

const Apple = styled.View`
  display: flex;
  width: 100%;
  margin: 8px 0px;
`;

export default {
  Container,
  Cafe,
  CafeImgView,
  AlternateLogin,
  AlternateLoginText,
  WebConf,
  LoadingText,
  LoadingContainer,
  Apple
};
